import style from './SearchBar.module.css'
import 'bootstrap/dist/css/bootstrap.min.css';


export default function SearchBar(props) {
   const onSearch = props
   return (
      <><div className={`form-group ${style.div}`}>
      <form className="row g-3">
            <div className="col-auto">
               <input type="search" className="form-control" placeholder="Agregar" />
            </div>
            <div className="col-auto">
            <button onClick={onSearch} className="btn btn-primary mb-3">Agregar</button>
            </div>
         </form>
         <input type="search" className="form-control" id="formGroupExampleInput" placeholder="Agregar"></input>

</div>
         </>
   );
}
